import React from 'react';

function Nhap(props) {
  // Sử dụng props.buttonClicked để thực hiện các xử lý liên quan đến việc render lại
  // Hoặc thay đổi giao diện của header.js khi ấn nút ở body.js
  // Ví dụ:
  const { buttonClicked } = props;
  return (
    <header>
      <h1>Đây là header</h1>
      {buttonClicked && <p>Đã ấn nút ở body.js</p>}
    </header>
  );
}

export default Nhap;
